#[derive(Debug, Clone)]
pub struct Block {
  pub block_type: Type,
  pub states: Vec<State>,
  pub properties: Vec<Property>,
}

#[derive(Debug, Clone)]
pub struct State {
  pub id: i32,
  pub default: bool,
  pub properties: Vec<Property>,
}

#[derive(Debug, Clone, PartialEq)]
pub enum Property {
  X,
  Y,
  Z,
  Stage(u8),
}

pub fn get_block_from_name(name: String) -> Block {
  return get_blocks().get(&name).cloned().unwrap_or(get_blocks().get("minecraft:air").cloned().unwrap());
}

